I saw @pink last night in Cincinnati at The Great American Ballpark. If you are a fan and you go to a Pink concert, you leave entertained, inspired and mesmerized by her incredible talent. If you are an entertainer and you go to a Pink concert, you leave thinking...I suck!  I am both so I left in awe, knowing I will never do anything that compares....and that's ok. 

@brandicarlile was also fantastic! She and Pink did a tribute to Sinead O'Conner and sang a moving rendition of "Nothing Campares 2 U"

#pink #pinkconcert #pinktour #concert #cincinnati

Leanne! What a journey it has been. We met in 2004 doing the “Southern Fried Chicks”. Then, there was “Hen Party,” “Country Cool Comedy Tour” and anything else we could pick up along the way.  As you have often said, there were some years when you couldn’t get arrested…but, look at you now!  You have a Netflix special, you’re on your second 100 city tour selling out everywhere, you shot a movie, named Forbes 50 over 50…and you are JUST GETTING STARTED!  

Aside from years of trying to keep a career going, we’ve helped each other through all of life’s ups and downs. There’s been chemo and car accidents, weddings and births, you’ve sent kids to college and had to “take to the bed” but whatever we were going through, there was always love, always laughter and ALWAYS TJ Maxx.  Happy birthday my friend!

@leannemorgancomedy
@trishsuhr 
@ettamaycomedy

