I had a great time this weekend working with Karen Morgan doing our show "The Karen's." Thanks to everyone who came out to the show, and special thanks to The Don Gibson Theatre and the Abbeville Opera House for having us! As an added bonus my friend Marcia went with me. Everybody needs a Marcia!  She is always positive, supportive and just a joy to be with! She also helps me write and has contributed many funny lines to my show.  When I am with Marcia, comedy always ensues!

